const n=[{text:"Trang chủ",to:"/"},{text:"Trang giới thiệu",to:"/about"},{text:"Liên hệ",to:"/contact"}],t={title:"Xây dựng sự hiện diện trực tuyến của bạn với Oleg Rõbnikov Web Development",text:["Xin chào, tôi là Oleg Rõbnikov, một nhà phát triển web chuyên nghiệp với nhiều năm kinh nghiệm trong việc xây dựng trang web và cửa hàng trực tuyến. Tôi chuyên cung cấp các giải pháp tùy chỉnh đáp ứng nhu cầu kinh doanh riêng của bạn. Các dịch vụ của tôi được thiết kế để nâng cao sự hiện diện trực tuyến của bạn và làm cho nó giúp bạn dễ dàng quản lý trang web hoặc cửa hàng trực tuyến của mình. Hãy để tôi giới thiệu cho bạn các sản phẩm và tính năng bổ sung của tôi có thể giúp bạn đạt được mục tiêu của mình."]},h=[{name:"blog",title:"Blog cá nhân hoặc trang chủ-giới thiệu-liên hệ",slogan:"Hãy giới thiệu bản thân với Blog cá nhân hoặc trang Trang chủ-Giới thiệu-Liên hệ của chúng tôi!",price:"từ 150 EUR.",text:["Oleg Rõbnikov Web Development cung cấp một Blog cá nhân hoặc trang Trang chủ-Giới thiệu-Liên hệ hoàn hảo cho các cá nhân hoặc doanh nghiệp nhỏ muốn giới thiệu thương hiệu cá nhân hoặc thông tin kinh doanh của họ. Tôi hợp tác với bạn để tạo một trang web có nội dung có thể chỉnh sửa và có thể mở rộng thành một hệ thống quản lý nội dung cho các hoạt động viết blog hoặc xuất bản khác của bạn. Dự án chỉ mất 3 ngày làm việc và bắt đầu với mức giá 150 EUR. Tôi tận tâm cung cấp trải nghiệm khách hàng tốt nhất cho khách hàng của mình và tôi tự hào mang đến những sản phẩm hàng đầu giải pháp notch đáp ứng nhu cầu cụ thể của họ."]},{name:"biz",title:"Trang Doanh nghiệp hoặc Ứng dụng Trang Đơn",slogan:"Nâng cao doanh nghiệp của bạn với Trang Doanh nghiệp hoặc Ứng dụng Trang Đơn của chúng tôi!",price:"từ 270 EUR.",text:["Đối với các doanh nghiệp lớn hơn, tôi cung cấp Trang Doanh nghiệp hoặc Ứng dụng Trang Đơn có thể giúp nâng doanh nghiệp của bạn lên cấp độ tiếp theo. Dự án cơ sở của tôi bao gồm nhiều hơn ba tuyến đường và bản trình bày động nội dung của bạn và sau đó có thể được mở rộng thành Ứng dụng Web lũy tiến cung cấp trải nghiệm người dùng tốt hơn cho khách hàng của bạn. Tôi hợp tác chặt chẽ với bạn để đảm bảo rằng sản phẩm cuối cùng đáp ứng nhu cầu kinh doanh của bạn và vượt quá mong đợi của bạn."]},{name:"shop",title:"Cửa hàng trực tuyến/trang thương mại điện tử",slogan:"Tăng doanh số bán hàng của bạn với Cửa hàng trực tuyến/trang thương mại điện tử của chúng tôi!",price:"từ 450 EUR.",text:["Nếu bạn đang muốn bán sản phẩm của mình trực tuyến, tôi có thể tạo một Cửa hàng trực tuyến/trang thương mại điện tử với thẻ sản phẩm và hệ thống thanh toán. Oleg Rõbnikov Web Development có thể giúp bạn tạo một cửa hàng trực tuyến đáp ứng nhu cầu kinh doanh của bạn."]}],c={title:"Ngôn ngữ, Lưu trữ, SEO và Dự án tùy chỉnh",text:["Tôi cung cấp nhiều tính năng bổ sung có thể giúp bạn cải thiện trang web hoặc cửa hàng trực tuyến của mình. Chúng bao gồm:","Có sẵn các ngôn ngữ bổ sung: tiếng Anh, tiếng Nga, tiếng Đức, tiếng Estonia, tiếng Việt, tiếng Trung có tính phí bổ sung.","Bạn sẽ cần dịch vụ lưu trữ và tên miền cho trang web của mình. Bạn có thể sử dụng dịch vụ của riêng mình hoặc tôi có thể cung cấp cho bạn với một khoản phí bổ sung.","Tối ưu hóa Công cụ Tìm kiếm cũng là một tính năng bổ sung. Tôi có thể giúp bạn tối ưu hóa trang web của mình cho các công cụ tìm kiếm, điều này sẽ giúp bạn xếp hạng cao hơn trong kết quả tìm kiếm và tăng lưu lượng truy cập trang web của bạn. Tôi tối ưu hóa bản thân việc xây dựng trang web để có tốc độ tải tốt nhất và cung cấp từ khóa , mô tả và quản lý nội dung với sự trợ giúp của Trí tuệ nhân tạo với một khoản phụ phí. Tính năng này có thể tăng thời gian gửi, nhưng nó rất đáng để đầu tư. Mục tiêu của tôi là giúp bạn đạt được kết quả tốt nhất có thể từ trang web hoặc cửa hàng trực tuyến của mình .","Cuối cùng, tôi cung cấp các dự án tùy chỉnh bao gồm mở rộng dự án hiện tại của bạn hoặc thực hiện các thay đổi để nâng cao thiết kế đồ họa, hiệu suất hoặc nội dung. Tôi tính phí theo giờ hoặc theo ngày hoặc theo tuần, tùy thuộc vào nhu cầu của bạn. Tôi cam kết cung cấp mức giá minh bạch và cam kết cao chất lượng dịch vụ cho tất cả các khách hàng của tôi."],price:["20 EUR/ giờ","150 EUR/ ngày làm việc 8 giờ","700 EUR/ tuần 5 ngày"]},i="Hãy liên hệ với Oleg Rõbnikov Web Development ngay hôm nay để tìm hiểu thêm về các dịch vụ của chúng tôi và cách chúng tôi có thể giúp bạn tạo sự hiện diện trực tuyến đại diện cho thương hiệu của bạn!",g={title:"Oleg Rõbnikov Web Development",reg:"Đăng ký tại Estonia như là một nhà kinh doanh độc thân 16629214 vào ngày 08/12/2022",text:["Nếu bạn có bất kỳ câu hỏi nào về dịch vụ của tôi, xin vui lòng liên hệ với tôi. Tôi sẽ rất vui lòng trả lời mọi câu hỏi của bạn và cung cấp cho bạn báo giá miễn phí. Tôi mong sớm nhận được tin từ bạn!"],email:"rybniko@gmail.com",phone:"+372 5604 5484",address:{title:"Địa chỉ",street:"Đường: Õismäe tee 65-47",zip:"Mã bưu chính: 13515",city:"Thành phố: Tallinn",province:"Tỉnh: Harjumaa",country:"Quốc gia: Estonia"},lat:59.437,lng:24.753},a={title:"Giới thiệu về Oleg Rõbnikov Web Development",text:["Tôi tận tâm cung cấp trải nghiệm khách hàng tốt nhất cho khách hàng của mình và tôi tự hào mang đến các giải pháp hàng đầu đáp ứng nhu cầu cụ thể của họ. Tôi làm việc chặt chẽ với bạn để đảm bảo sản phẩm cuối cùng đáp ứng nhu cầu kinh doanh của bạn và vượt qua mong đợi của bạn. Tôi cam kết cung cấp giá cả minh bạch và dịch vụ chất lượng cao cho tất cả khách hàng của mình.","Năm 2003, tôi tốt nghiệp Đại học Quốc tế Concordia Estonia. Đây là một cột mốc quan trọng trong việc học tập của tôi và giúp tôi phát triển kỹ năng mà tôi sử dụng đến ngày hôm nay. Giáo dục tôi nhận được tại Concordia đã mang lại lợi thế cạnh tranh cho tôi trong thế giới phát triển web.","Năm 2002, tôi đã xây dựng trang web đầu tiên của mình. Đây là một thời điểm thú vị đối với tôi, khi tôi khám phá ra niềm đam mê của mình với phát triển web. Kinh nghiệm này đã giúp tôi có được kiến thức và kinh nghiệm thực tiễn trong xây dựng trang web, đặt nền tảng cho tương lai của tôi trong ngành.","Năm 2007, sự quan tâm của tôi đến các hệ thống giáo dục trực tuyến, phương tiện truyền thông xã hội, SEO và Google Ads bắt đầu tăng. Kết quả, tôi trở thành một chuyên gia về xu hướng và công nghệ mới nhất, mang lại lợi thế cho tôi trong lĩnh vực tiếp thị số.","Sự xuất hiện của thời đại tiếp thị trên phương tiện truyền thông xã hội đã đưa ra một cơ hội mới cho tôi. Xây dựng trang trên Facebook và quảng cáo trên Instagram là các cách hiệu quả để thúc đẩy lưu lượng truy cập đến các trang web. Sự quen thuộc của tôi với các nền tảng này đã giúp tôi có lợi thế trong việc phát triển các chiến dịch truyền thông xã hội thành công.","In 2019, tôi tham gia các khóa học JavaScript trực tuyến với Pirple.com. Đây là một trải nghiệm đáng giá khi tôi làm quen với các framework React, Vue frontend, cũng như Astro.js, Svelte. Tôi quyết định làm việc chủ yếu với Vue và Vite, vì chúng cung cấp nhiều lợi ích nhất cho các dự án của tôi.","Năm 2020, tôi bắt đầu làm việc với PHP và Laravel. Đây là một trải nghiệm mới khác mở rộng kỹ năng của tôi và cho phép tôi đảm nhận nhiều dự án đa dạng hơn.","Năm 2022, tôi thành lập công ty Oleg Rõbnikov Web Development, chuyên phát triển blog, ứng dụng trang đơn và cửa hàng trực tuyến. Khả năng đa dạng về kỹ năng của tôi, được tích lũy từ nhiều năm kinh nghiệm và giáo dục, cho phép tôi cung cấp các giải pháp chất lượng cho khách hàng. Lợi thế cạnh tranh của tôi nằm ở khả năng thích ứng với công nghệ mới và theo kịp xu hướng của ngành."]},o={nav:n,self:t,prod:h,extras:c,action:i,contacts:g,about:a};export{a as about,i as action,g as contacts,o as default,c as extras,n as nav,h as prod,t as self};
